import React from 'react';
import {
  BrowserRouter as Router,
  Switch,
  Route
} from "react-router-dom";


import Bike from './components/bike';
import Bikes from './components/bikes';

export default function Pages() {
  return (
    <Router>
        <Switch>
          <Route exact path="/">
            <Bikes />
          </Route>
          <Route path="/:id" component={Bike}>
            <Bike />
          </Route>
        </Switch>
    </Router>
  );
}
